import React,{ useEffect, useState } from 'react';
import './app.css';
import Video_list from './componets/video_list/video_list';

function App() {
  const [videos, setVideos] = useState([]);
  
  useEffect(() => {
    var requestOptions = {
      method: 'GET',
      redirect: 'follow'
    };
    
    fetch("https://www.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&maxResults=15&regionCode=KR&key=AIzaSyAdKiYBVAtwzpuVYaDwwpcq71x2Z4urqv0", requestOptions)
      .then(response => response.json())

      .then(result => setVideos(result.items))
      .catch(error => console.log('error', error));

  }, []);
  console.log(videos);
  return <Video_list videos={videos} />;
  
}

export default App;
